var jsAddress = Forguncy.Page.getCell("combineAddress01").getValue();

const xhr = new XMLHttpRequest();
xhr.open('GET', jsAddress);
xhr.setRequestHeader('Authorization' , 'Basic dGVzdF9za19PNkJZcTdHV1BWdjRrOUtaWTQ3OE5FNXZibzFkOg==');
xhr.send();

xhr.onreadystatechange = function (e) {
  if (xhr.readyState !== XMLHttpRequest.DONE) return;

  if(xhr.status === 200) {
    //console.log(xhr.responseText);
    console.log("API Status : "+xhr.status);
    Forguncy.Page.getCell("setStatusResult01").setValue(xhr.status+" OK");
  } else {
    console.log("Error!");
    Forguncy.Page.getCell("setStatusResult01").setValue(xhr.status+" Error");
  }
};

